        yt:format=''6''/><media:credit role=''uploader'' scheme=''urn:youtube'' yt:display=''parkinggod''>parkinggod</media:credit><media:description
        type=''plain''>September 3, 2011. Michigan 34, Western Michigan 10. Lightning
        brought this game to an end late in the third quarter, which was probably
        just as well for the Broncos as Michigan was starting to pull away. Michigan
        spotted Western a touchdown but outscored them 34-3 the rest of the way. Brandon
        Herron had a 94-yard interception return for a touchdown (longest in school
        history) and a 28-yard fumble return for a touchdown, the first time a Michigan
        player has ever returned two turnovers for touchdowns in the same game. Fitzgerald
        Toussaint ran for 80 yards and two touchdowns (2, 1) and Michael Shaw added
        54 yards and a touchdown (44). Jordan Kovacs helped pace the defense with
        two sacks and a forced fumble.</media:description><media:keywords>Michigan,
