        role=''uploader'' scheme=''urn:youtube'' yt:display=''omarTVV''>omartvv</media:credit><media:description
        type=''plain''>Please. Rate, Comment and Subscribe :) Italy footballer Morosini
        dies after collapse on pitch x-Italy under-21 footballer Piermario Morosini
        has died following a suspected heart attack on the pitch, football officials
        say. The midfielder was playing for Livorno in the Serie B match at Pescara
        when he fell to the ground in the 31st minute. A defibrillator was used and
        Morosini, 25, was taken to hospital. The game was halted with other players
        in tears. All league games in Italy this weekend have been called off following
        Morosini''s death.</media:description><media:keywords>Death (Literature Subject),
